css:
@-moz-document domain("developers.google.com") {
body {
    background-color: rgb(51, 51, 51);
}
pre,
code {
    background-color: rgb(41, 44, 46);
    color: rgb(141, 141, 141);
}
p,
div,
span {
    color: rgb(141, 141, 141);
}
.devsite-footer-promo-title {
    color: white;
}
h1,
h2,
h3 {
    color: rgb(73, 147, 197);
}
ul {
    background-color: rgb(36, 37, 38);
}
.devsite-section-nav,
.devsite-page-nav {
    background-color: rgb(36, 37, 38);
}
.devsite-breadcrumb-list {
    background-color: rgb(0, 188, 212);
}
.devsite-header-link-label,
.devsite-header-link-icon,
.material-icons {
    color: rgb(36, 37, 38);
}
.devsite-breadcrumb-link {
    background-color: rgb(0, 151, 167);
}
}
